import React from 'react';
import Button from 'react-bootstrap/Button';

class LiftConsoleButton extends React.Component {
    submit_request(to_floor, from_floor)
    {
        console.log("ERROR");
        fetch('http://localhost:8000/api/lift/request/', {
        method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json',
        },
        body: JSON.stringify({
            from_floor: 2,
            to_floor: 4,
        })
        });
    }

    render() {
      return (<Button variant="primary" onClick={() => submit_request(this.props.index, this.props.floor)}>{this.props.index}</Button>)
    }
}

export default LiftConsoleButton;
